                            // /* keyboard navigation */
                            $(document.documentElement).keyup(function(event) {
                                if (event.keyCode == 37) {
                                    /*left key*/
                                    owlWB.trigger('prev.owl.carousel', [700]);


                                } else if (event.keyCode == 39) {
                                    /*right key*/
                                    owlWB.trigger('next.owl.carousel', [700]);
                                }
                            });

                            function addDotButtonTextWB() {

                                // loop through each dot element
                                $('.wbt-webexamples .owl-dot').each(function() {
                                    // remove old text nodes
                                    $(this).find('.sr-only').remove();

                                    // grab its (zero-based) order in the series
                                    let idx = $(this).index() + 1;

                                    // append a span to the button containing descriptive text
                                    $(this).append('<div class="sr-only">Go to slide ' + idx + '</div>');
                                });
                            }







